package com.el.entity.apporder;

import java.util.TreeMap;

public class OrderUser {

	public OrderUser() {
		// TODO Auto-generated constructor stub
	}

	private String name;
	private String phone;
	private int gender;
	private String address;
	private String longitude;
	private String latitude;
	private String province;
	private String city;
	private String district;

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public String getPhone() {
		return phone;
	}

	public void setPhone(String phone) {
		this.phone = phone;
	}

	public int getGender() {
		return gender;
	}

	public void setGender(int gender) {
		this.gender = gender;
	}

	public String getAddress() {
		return address;
	}

	public void setAddress(String address) {
		this.address = address;
	}

	public String getLongitude() {
		return longitude;
	}

	public void setLongitude(String longitude) {
		this.longitude = longitude;
	}

	public String getLatitude() {
		return latitude;
	}

	public void setLatitude(String latitude) {
		this.latitude = latitude;
	}

	public String getProvince() {
		return province;
	}

	public void setProvince(String province) {
		this.province = province;
	}

	public String getCity() {
		return city;
	}

	public void setCity(String city) {
		this.city = city;
	}

	public String getDistrict() {
		return district;
	}

	public void setDistrict(String district) {
		this.district = district;
	}

	public TreeMap<String, Object> toMap() {
		TreeMap<String, Object> treeMap = new TreeMap<String, Object>();
		treeMap.put("name", name);
		treeMap.put("phone", phone);
		treeMap.put("gender", gender);
		treeMap.put("province", province);
		treeMap.put("city", city);
		treeMap.put("district", district);
		treeMap.put("address", address);
		treeMap.put("latitude", latitude);
		treeMap.put("longitude", longitude);
		return treeMap;
	}

}
